Inequality for two `UniqueRc`s.

Two `UniqueRc`s are not equal if their inner values are not equal.

# Examples

```
#![feature(unique_rc_arc)]
use std::rc::UniqueRc;

let five = UniqueRc::new(5);

assert!(five != UniqueRc::new(6));
```
